import React from 'react'

function Nav() {
  return (
    <div id='NAV'>
        <div  className="fpp1"><img src={require("./pp.jpg")} alt=""/><span>Niccolò</span></div>
        <div  className="fpp1"><span>Niccolò</span></div>

    </div>
  )
}

export default Nav
